/**
 * Function that is called during the JavaScript Task execution.
 * @param {IntegrationEvent} event
 */
function executeScript(event) {
    var firebaseObject = event.getParameter("`Task_19_response`");

    var newRole = event.getParameter("role");

    var firestoreWriteObject = {
        "writes": []
    }

    event.setParameter("firestoreWriteObject", firestoreWriteObject);

    if (firebaseObject) {
        // User found, add role
        if (firebaseObject.fields.roles) {
            firebaseObject.fields.roles.arrayValue.values.push({
                "stringValue": newRole
            });
        }
        else {
            firebaseObject.fields["roles"] = {
                "arrayValue": {
                    "values": [
                        {
                            "stringValue": newRole
                        }
                    ]
                }
            };
        }

        delete firebaseObject.createTime;
        delete firebaseObject.updateTime;

        firestoreWriteObject.writes.push({
            "update": firebaseObject
        });

        var jsonDoc = documentToJson(firebaseObject.fields);
        event.setParameter("userObject", jsonDoc);
    }
    else {
        // User not found
        event.log("User not found!");
        throw "User not found."
    }

    event.setParameter("firestoreWriteObject", firestoreWriteObject);
}


function documentToJson(fields) {
  var result = {};
  for (var f in fields) {
    var key = f,
      value = fields[f],
      isDocumentType = ['stringValue', 'booleanValue', 'doubleValue',
        'integerValue', 'timestampValue', 'mapValue', 'arrayValue', 'nullValue'
      ].find(t => t === key);
    if (isDocumentType) {
      var item = ['stringValue', 'booleanValue', 'doubleValue', 'integerValue', 'timestampValue', 'nullValue']
        .find(t => t === key)
      if (item)
        return value;
      else if ('mapValue' == key)
        return documentToJson(value.fields || {});
      else if ('arrayValue' == key) {
        var list = value.values;
        return !!list ? list.map(l => documentToJson(l)) : [];
      }
    } else {
      result[key] = documentToJson(value)
    }
  }
  return result;
}

